import './Contact.css'

const Contact = () => {
    return (
        <section id="contact">
            <div className='contact'>
                <h2 className="title">Contact Me</h2>
                <h3 className='info-item'>Email: Fadi2002.ba@gmail.com</h3>
                <h3 className='info-item'>Phone Number: 17093304413</h3>
            </div>
        </section>
    );
}

export default Contact;
